INSERT INTO `houses` (`id`, `user_id`, `slug`, `meta_title`, `meta_description`, `title`, `address`, `road`, `youtube`, `description`, `lat`, `lng`, `price`, `m2`, `money_unit`, `category`, `city`, `district`, `ward`, `toilet`, `floors`, `direction`, `bedroom`, `kitchen`, `living_room`, `common_room`, `balcony`, `logia`, `license`, `is_owner`, `is_sale`, `start_date`, `end_date`, `feature`, `images`, `created_at`, `updated_at`) VALUES
(1, 1, 'chinh-chu-ban-nha-994b33f', 'chính chủ bán nhà 994b/33f', 'chính chủ bán nhà 994b/33f', 'chính chủ bán nhà 994b/33f', '994B/33F Huỳnh Tấn Phát', '4', '', 'Chào Quý Anh Chị!\r\nTôi cần bán nhà sổ hồng chính chủ, số 994B/33F Huỳnh Tấn Phát, Phường Tân Phú, Quận 7. Nhà cách cầu Phú Mỹ 2km, kết nối thuận tiện, Phú Mỹ Hưng, Quận 1, Quận 2.\r\n- Diện tích 4x11m, 1 trệt, 1 lửng, 1 lầu, 2WC, 3 phòng ngủ.\r\n- Nhà mới, gần chợ, gần trường học.\r\n- Khu dân trí cao, hàng xóm thân thiện và đoàn kết.\r\n- Phong thủy cực tốt: nhà hướng Đông Nam, thoáng mát, nuôi dưỡng 5 anh em trai chúng tôi học đại học.\r\nGiá bán 1,3 tỷ (bớt lấy hên chút đỉnh cho anh chị thiện chí).\r\nAnh chị quan tâm xin liên hệ chính chủ: 0938671686 hoặc 0973338835.', 10.753975, 106.621762, 12, 44, 3, 1, 2, 2, 2, 0, 0, 2, 0, 0, 3, 5, 0, 0, 4, 1, 0, '2015-09-27', '2015-10-27', '["1","4","5","8","14"]', '[]', '2015-09-27 03:13:21', '2015-09-27 03:13:21'),
(2, 1, 'cho-thue-nha-rieng-cuc-dep-ngo-68-cau-giay', 'cho thuê nhà riêng cực đẹp, ngõ 68 cầu giấy', 'cho thuê nhà riêng cực đẹp, ngõ 68 cầu giấy', 'cho thuê nhà riêng cực đẹp, ngõ 68 cầu giấy', 'ngõ 68', '2', '', 'Cho thuê nhà riêng cực đẹp, ngõ 68 Cầu Giấy. Nhà cho thuê 6 tầng, mỗi tầng 2 phòng, đều khép kín, tổng có 6 phòng ngủ, chưa kể phòng thờ & bếp, phòng khách, các phòng đều khép kín hết, DT nhà rộng: 53m2, MT: 4m2, ngõ rộng: Hơn 6m2, nhà hướng Đông - Nam, taix đỗ trước cửa nhà, mà 2 bên đường để xe rất nhiều nên xe vào hơi chật tí, để xe thoải mái thì ô tô cách nhà gần 200 km, có bãi gửi xe, Nhà mới xây - kiến trúc pháp, thiết kế thoáng, đẹp, cầu thang gỗ, gỗ lim sịn & cửa lim, sàn gỗ công nghệ cao cấp, nhà.\r\nGần chợ, Gần trường, Gần bệnh viện, rất thuận tiện giao thông, nên rất tiện kinh doanh, VP, ở, An ninh tốt.\r\nCó sân để xe, Đường truyền ADSL, Cáp, Điện thoại, Nóng lạnh - bình Thái Dương Năng.\r\nNhà đẹp, xem là ưng luôn, nhà cho thuê lâu dài.', 21.030961, 105.792694, 15, 11, 3, 3, 1, 5, 4, 2, 0, 3, 3, 0, 0, 0, 0, 0, 0, 2, 1, '2015-09-27', '2015-10-27', '["1","5","11","15"]', '["122941.27092015.0.jpg","122941.27092015.1.jpg"]', '2015-09-27 03:29:42', '2015-09-27 03:29:42');
